INSERT INTO `jian_news_data` VALUES('42','表妹小灵打电话给我：&ldquo;哥，我在学校闯祸了，老师让我明天带我爸过去！&rdquo;\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">&nbsp;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">我说：&ldquo;妹子，这不合适吧，虽说我比你大十岁，但跟舅舅还是有差距的！&rdquo;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">表妹道：&ldquo;哥，你成熟稳重，大方得体，再合适都没有了！&rdquo;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">被她一奉承，我就乐呵呵地答应了，第二天，还特意穿了件老式的衣服去！</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">到了学校，老师一见我，赶紧起身迎接。</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">我有点受宠若惊，却听得老师道：&ldquo;您是小灵她爷爷吧，大爷，您快请坐！&rdquo;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">我：......</p>\r\n','0','','0','0','','0','','0','1','|0','3','0');
INSERT INTO `jian_news_data` VALUES('43','记得第一次去媳妇家，吃完饭，媳妇和她母亲在厨房收拾碗筷，她父亲跟我在客厅聊天，突然老爷子神秘兮兮的跟我说：小伙子，以后没事常来家里，最好天天来，当时我还真挺乐的，没想到她父亲这么稀罕我，后来有一天跟媳妇说到这个事，她笑嘻嘻的说：你真以为你多好啊？他让你天天去，是因为家里来客人了我妈给他面子不用他洗碗！','0','','0','0','','0','','0','1','|0','4','0');
INSERT INTO `jian_news_data` VALUES('44','一朋友说：&ldquo;和....和....和我取....取点钱去&rdquo;我问：&ldquo;你卡带了吗？&rdquo;&ldquo;卡....卡....卡你妹啊....老....老娘这是口....口吃&rdquo;，我：&ldquo;我是问你卡！卡带了吗？&rdquo;答：&ldquo;操....草你X的，还....还学我&rdquo;','0','','0','0','','0','','0','1','|0','2','0');
INSERT INTO `jian_news_data` VALUES('45','最近迷上了球星梅西，上课在本子上写 &ldquo;梅西我爱你&rdquo;\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">被老师发现了 &ldquo;梅西是谁？&rdquo;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">&ldquo;那个&hellip;&hellip;那个&hellip;&hellip;&rdquo;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">&ldquo;下课和梅西一起到我办公室！&rdquo;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">&ldquo;叫不来！&rdquo;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">叫不来？叫不来我帮你叫！&rdquo;</p>\r\n<p style=\"margin: 0px; padding: 0px; border: 0px; font-size: 16px; font-family: 微软雅黑; color: rgb(43, 43, 43); line-height: 28px; position: relative;\">卧艹，幸福来的太突然？</p>\r\n','0','','0','0','','0','','0','1','|0','4','0');
INSERT INTO `jian_news_data` VALUES('46','惬意的咖啡馆里，进来一个身穿西装，戴着墨镜，夹着公文包的人，一看就是个高管范儿！他走到我们旁边桌坐了下来，点了一杯咖啡，然后利索的拿出笔记本电脑，噼噼啪啪开始敲打键盘，两眼不离屏幕！老婆两眼放光的看着他：&ldquo;这人一定是成功人士，你看多敬业，走到哪都工作！&rdquo;我心里那个不爽啊，突然从那货电脑里传出一声熟悉的声音：&ldquo;抢地主。。。！&rdquo;我老婆当场就凌乱了！','0','','0','0','','0','','0','1','|0','3','0');
INSERT INTO `jian_news_data` VALUES('47','星期天，我和我媳妇儿没事就到隔壁老吴家串门去。我无意间就发现我媳妇儿那手机自动就连上无线了，我当时我就怒了！！我一巴掌就打了过去，说你咋了，你这个贱人，有他家无线密码不告诉我啊！！！','0','','0','0','','0','','0','1','|0','3','0');
INSERT INTO `jian_news_data` VALUES('48','陪我们老总出差，女的。<br style=\"color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 28px;\" />\r\n到了地方，找宾馆，都是满的。<br style=\"color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 28px;\" />\r\n老总累的不行，到了一家4星级酒店还是没房间，她实在不想走了。<br style=\"color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 28px;\" />\r\n等了一会儿她说：你先坐着喝杯水，我去想办法。<br style=\"color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 28px;\" />\r\n然后她走到走廊里：贱人，你跟那狐狸精今天跑不掉了！给我滚出来。<br style=\"color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 28px;\" />\r\n然后我们在大厅了喝水，不一会儿，就有5-6个人退房了。<br style=\"color: rgb(102, 102, 102); font-family: Arial, Helvetica, sans-serif; font-size: 14px; line-height: 28px;\" />\r\n我暗叹：不愧是老总，真特么机智！','0','','0','0','','0','','0','1','|0','3','0');
INSERT INTO `jian_news_data` VALUES('49','<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; list-style: none; font-size: 14px; line-height: 23px; color: rgb(0, 0, 0); font-family: 宋体;\">\r\n<li>有妞不泡,大逆不道。见妞就泡,替天行道。胸脯高高,越摸越骚。小腰细细,身怀绝技。身材小巧,没完没了。屁股翘翘,要完还要。</li>\r\n</ul>\r\n','0','','0','0','','0','','0','1','|0','2','0');
