INSERT INTO `jian_news_data` VALUES('51','<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; list-style: none; font-size: 14px; line-height: 23px; color: rgb(0, 0, 0); font-family: 宋体;\">\r\n<li>读书时一直暗恋她，但没勇气表白，更没胆量碰她。毕业后，她已经结婚了，老公跟我是同学。那天下午，她抱着娃娃在喂奶，我找了个很好的借口。我走到她面前，一把两手按住她的咪&times;咪，然后跟她娃娃说，喊叔叔，不喊不给吃!&nbsp;</li>\r\n</ul>\r\n','0','','0','0','','0','','0','1','|0','2','0');
