INSERT INTO `jian_news_data` VALUES('55','一小姐看到医生给开的B超检查单却不知在哪儿做。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n小姐：医生，这个13超在哪儿呢？<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n医生：不是13超，是B超！<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n小姐：你这个B分的也太开了!（大声）','0','','0','0','','0','','0','1','|0','1','0');
INSERT INTO `jian_news_data` VALUES('56','推销员因为工作忙一个星期有五天不在家，自然对太太有所歉意，想利用整个周末补偿她！<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n一个星期六，当他们在那张会嘎嘎做响的床上亲热时&hellip;&hellip;忽然！！<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n隔壁的老太太用力敲着墙壁，大喊着：你们有完没完！！！一个星期有七天！你们就不能休息一天吗？','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('57','爸爸妈妈带着阿呆去加利福尼亚的海滩度假。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n海滩上的老外们都一丝不挂的裸泳。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n阿呆：爸爸，你的鸡鸡怎么没有那些叔叔的大？<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n爸爸：......因为......那些叔叔比爸爸有钱。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n过了一会儿。阿呆想喝可乐，爸爸一人去上店里买。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n阿呆和妈妈留在海滩，可是爸爸回来后发现妈妈不见了。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n爸爸：你妈妈呢？<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n阿呆：爸爸，你刚走后，来了一个很有钱的叔叔，他看着我妈妈，钱是越来越多越来越多，后来我妈妈就跟他走了。','0','','0','0','','0','','0','1','|0','3','0');
INSERT INTO `jian_news_data` VALUES('58','穷小伙写了一个字，帮全村娶上了漂亮媳妇\r\n<div>村子很穷，<br />\r\n小伙带过很多女孩回家认门，<br />\r\n都因买不起房子，都离他而去。<br />\r\n<br />\r\n小伙总结了经验，于是他买了桶漆，<br />\r\n从村头到自己家的路上，<br />\r\n见墙就都刷个大大的『拆』字，<br />\r\n<br />\r\n后来他就结婚了。<br />\r\n再后来村里的小伙们也都陆续的娶上媳妇。<br />\r\n<br />\r\n十年过去了，<br />\r\n跟她结婚的女子，每天搂着九岁的孩子，<br />\r\n房子依旧那么破，依旧没有拆迁，<br />\r\n一边哭一边说:<br />\r\nTMD的，当时也没问个日期....&nbsp;</div>\r\n','0','','0','0','','0','','0','1','|0','2','0');
