INSERT INTO `jian_news_data` VALUES('61','花去相亲，提出一个问题，谁的答案符合她的标准，她就和他交往，问题是：你们一千米长跑用时多久？<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n一胖子说道：&ldquo;我用一分钟就可以跑完！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n翠花不屑道：&ldquo;太虚伪，下一个！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n又一个瘦子上来说到：&ldquo;我大概三分钟，是正常范围！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n翠花微微一笑：&ldquo;下一个！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n又来一个土豪说道：&ldquo;一千米我倒是没跑过，不过我开着跑车绕着我家一千米的院子大概就十几秒吧！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n翠花开心道：&ldquo;讨厌我就是喜欢你这么诚实的男人！&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('62','调查组：有人举报你带着女同学去开房，有没有这件事？<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n王老师：那不是开房，是我单独给她辅导作业&hellip;&hellip;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n调查组：那有人举报你在办公室亲吻女生是怎么回事？<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n王老师：那是我小声和她说话，结果太近了，不小心碰到的&hellip;&hellip;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n调查组：那你考试的时候把手伸进女生的裙子底下，还被人拍了照片，这个你又怎么解释？<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n王老师：这个&hellip;&hellip;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n调查组：说呀！<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: 宋体; font-size: 14px; line-height: 28px;\" />\r\n王老师：额&hellip;&hellip;其实我那次考试就是为了摸底&hellip;&hellip;','0','','0','0','','0','','0','1','|0','0','0');
