INSERT INTO `jian_news_data` VALUES('76','一个男人厌倦了他每天出门工作而他的老婆却整天呆在家里。他希望老婆能明白他每天是如何在外打拼的。于是他祷告祈求：全能的主啊，我每天在外工作整整八小时，而我的老婆却仅仅是呆在屋里，我要让她知道我，我是怎么过的，求你让我和她的躯体调换一天吧！阿门。无限智慧的主满足了他的愿望。\r\n<p style=\"margin: 0px 0px 20px; padding: 0px;\">　　第二天一早，他醒来，当然，是作为一个女人。他起床为他的另一半准备早点，叫醒孩子们，为他们穿上校服，喂早餐，装好他们的午餐，然后开车送他们去学校，回到家，他挑出需要干洗的衣物，送到干洗店，回来的路上还顺路去了银行，然后去超市采购，回到家，放下东西，要缴清帐单、结算支票本。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px;\">　　当他打扫了猫盒，给狗洗完澡，已经是下午一点了。他匆忙地整理床铺，洗衣服，给地毯吸尘，除尘，清扫，擦洗厨房的地板。他冲往学校去接孩子们，回来的路上还同他们争论了一番。他准备好点心和牛奶，督促孩子们做功课，然后架起烫衣板，一边忙着一边看会电视。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px;\">　　四点半的时候，他开始削土豆，清洗蔬菜做沙拉，给猪排沾上面包屑，剥开那些新鲜的豆子，准备晚餐。吃完晚饭，他开始收拾厨房，打开洗碗机，叠好洗干净的衣物，给孩子们洗澡，送他们上床。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px;\">　　晚上九点，他已经撑不住了，然而，他的每日例行工作还没结束。他爬上床，在那里还有人期待着他，他必须，而且不能有任何抱怨。</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px;\">　　第二天一早，他一醒来就跪在床边，向主祈求：主啊，我真不知道自己是怎样想的，我怎么会傻到嫉妒我老婆能成天呆在家里？求你，哦！求求你，让我们换回来吧！</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px;\">　　无限智慧的主，回答他：我的孩子，我想你已经吃到苦头了，我会很高兴让一切恢复原来的样子。但是......</p>\r\n<p style=\"margin: 0px 0px 20px; padding: 0px;\">　　你不得不再等上九个月，昨晚，你怀孕了。</p>\r\n<ul style=\"margin: 0px; padding-right: 0px; padding-left: 0px; list-style: none; font-size: 14px; line-height: 23px; color: rgb(0, 0, 0); font-family: 宋体;\"></ul>\r\n','0','','0','0','','0','','0','1','|0','0','0');
