INSERT INTO `jian_news_data` VALUES('96','我在一设计公司上班。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n某日，一女同事大声呼叫道：呀，断网了。经理，出来帮看看嘛。经理慢悠悠地出来，看了看女同事的机子，悠哉的说道：没事，只是网线借口坏了，帮你换条得了。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n之后经理找了一捆网线，扯出一条稍微长点的，开始接起来。<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n另一个女同事看到就打趣说道：这根怎么那么长？&nbsp;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n经理得意的说道：那是，这根长得很。&nbsp;<br style=\"margin: 0px; padding: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; line-height: 28px;\" />\r\n这时我实在忍不住了，就贸贸然地憋出一句：长是够长了，就是细了点','0','','0','0','','0','','0','1','|0','0','0');
