INSERT INTO `jian_news_data` VALUES('150','结婚前，丈母家给我下了盘好大的棋。那天到她们家却没人，进门后只见美艳的小姨子赤裸裸躺在沙发上哭泣，感到情形不妙立马往回跑！只听小姨子哭着说：&ldquo;来了，就别走，没人！&rdquo;我才停下我沉重脚步！问：&ldquo;为啥哭得这么伤心！&rdquo;小姨哭着说：&ldquo;后天你就要跟我姐结婚了！&rdquo;我：&ldquo;不好嘛？&rdquo;小姨哭着喊：&ldquo;你知道嘛，我一直在背后默默的爱你，我恨不得跟你步入婚姻殿堂的是我而不是我姐，从小到大我一直在让我姐但我不想将来之不易的幸福也拱手相让！你能抱抱我给点温暖嘛？&rdquo; 听到这我头也不回的往门口走！结果丈母一家拍着手掌称好的从厨房出来说：&ldquo;找老公就得找这种不偷吃的好男人！&rdquo;时隔今天我只想说的是当时我只想回头顺便把门给关上而已。','0','','0','0','','0','','0','1','|0','0','0');
