INSERT INTO `jian_news_data` VALUES('159','练车前，师父叫我看看油还有多少。 我拧开油箱盖看了半天也没看清楚，光线太暗。我顺手摸出打火机凑近油箱口，就在我准备按下打火机的时候师父一脚把我踹飞了，尼玛这师傅脾气太坏了。我强忍着没发火，练车时，刚好是下坡，一紧张猛踩油门，教练大喊：&ldquo;刹车！！用脚刹！ &rdquo;我连忙打开车门，一只脚放在地上，摩擦摩擦似魔鬼的步伐！拖行了20多米，终于停下来了！教练吓傻了，拿十块钱让我去给他买盒中华压压惊！当时我就很纳闷，怎么还有拿牙膏压惊的！当我把中华牙膏递给他时，他默默的退还了全部学费，说：隔壁还有一家.我说我就是隔壁那.....','0','','0','0','','0','','0','1','|0','1','0');
