INSERT INTO `jian_news_data` VALUES('164','铁扇公主宴请孙悟空。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n喝了不少酒，铁扇公主媚态横生，道：&ldquo;叔叔，那老牛撇下了我，我要寂寞呢！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n悟空：&ldquo;真是苦了嫂嫂了！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n铁扇公主：&ldquo;一寂寞下面就痒痒的，叔叔，人家想要你进入我的身体！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n悟空道：&ldquo;好啊！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n铁扇公主大喜：&ldquo;那你还不快来！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n却见悟空迅速变小，钻进她的身体里，还在肚子里喊道：&ldquo;嫂嫂想我进入你的身体检查一下，这个简单啊！咦，嫂嫂，你这是长了蛔虫啊，难怪会痒！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n铁扇公主：......','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('165','男同事：小美女怎么了，看你表情就像失身了似的？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n美女：比失身还难受！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男同事：到底怎么啦？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n美女：还不是早上挤公交车的事情。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男同事：这没办法，上班高峰期嘛，我早上也是挤了三辆车才挤上去！怎么你是不是一直没挤上车？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n美女：不，我第一辆就挤上去了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男同事：那还难受什么？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n美女：问题是我的裙子没有挤上去！','0','','0','0','','0','','0','1','|0','0','0');
