INSERT INTO `jian_news_data` VALUES('167','朝鲜发射火箭失败，没能拥有自己的卫星。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n于是找到中国，请求在登月火箭上搭载自己的卫星。中国答应了对方的要求。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n发射当天，中国负责人问朝鲜负责人：&ldquo;你们的卫星呢，怎么还不运来！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n朝鲜负责人说：&ldquo;来了来了！&rdquo;然后提着一个箱子来了。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n中国负责人惊讶道：&ldquo;卫星这么小？你们朝鲜技术有这么先进？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n打开一看，居然是金正恩的相片！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n一时不明所以：&ldquo;这是怎么回事？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n朝方道：&ldquo;要知道，月球是地球的卫星！只要你们把伟大领袖的相片发到月球上去，这颗卫星就是我们大朝鲜的了！&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
