INSERT INTO `jian_news_data` VALUES('208','老婆：老公，如果哪天有人用100万和你换我，你愿意吗？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老公：不愿意！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：老公，你真好！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老公：首先没有那个傻子愿意拿100万换你的，其次如果人家真拿100万换你，我也不想坑人家！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：滚！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('209','昨天晚上和老婆躺在床上，我心血来潮的问她：你当初为什么选择了我？老婆想都没想就说：因为你是和我睡觉唯一一个不打呼噜的男人。我听后有点生气，便回答：那你睡过的男人不少啊！这时，老婆又说：你睡过的女人也很多啊！我问：你凭什么这样说？老婆解释道：因为我记得你上次说过我是和你睡觉唯一一个打呼噜的女人！','0','','0','0','','0','','0','1','|0','0','0');
