INSERT INTO `jian_news_data` VALUES('215','今天跟男朋友出去开房。到了房间男朋友迫不及待的把我压在身下。又是亲又是摸的。正待我准备宽衣解带的时候。男朋友突然站起来走到了窗台点了跟烟，狠狠的吸了一口说：然，我看还是算了。等结婚再说吧！<br />\r\n　　我心里又是高兴又是难过。高兴的是男朋友人真好。难过的是，我这23年的防线你什么时候能攻破啊！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('216','男：昨天在街上突然内急，没带纸，附近又没商店，找了半天才找到一个ATM机，于是我就提了500块搞定，<br />\r\n女：土豪啊，我们做朋友吧！不过你这是侮辱人民币你造吗？<br />\r\n男：可以啊！不过我取了5次，每次都取100，每次都让机器给我打印一张凭条，你以为呢？<br />\r\n女：&hellip;&hellip;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('217','宅男在拔墙上的钉子。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n妈妈问：&ldquo;拔钉子做什么？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n宅男：&ldquo;我女朋友要来了。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n妈妈惊喜道：&ldquo;嗨，你都有女朋友了，也不早跟妈妈说，那是得拔干净喽，扎到了破皮可不好！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n宅男：&ldquo;是啊，一破皮就会漏气的！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n妈妈：&ldquo;漏气？呃......&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('218','老公外出学习半个月，返回时刚进家门，就告诉老婆买了一袋好东西。老婆问是啥好东西，老公说是与她有关的豆类。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆想了想，喜笑颜开地猜测：&ldquo;你我分别了半个月，想必你早就想死我了。你买的一定是代表男女相思的红豆！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老公闻听，把头摇成了拨浪鼓：&ldquo;不对，你太多情了。我买的是和你的肤色不相上下的黑豆！&rdquo;老公话音刚落，脸上就落下了老婆的风轮掌！','0','','0','0','','0','','0','1','|0','0','0');
