INSERT INTO `jian_news_data` VALUES('220','　　昨天一个平静夜晚，我闲来无事去做足疗。给我捏脚的小姑娘穿得有些妖艳，说话轻佻，按着按着手就开始往上抓。我当时脑子里就一个念头，绝对不能做大保健，任她怎么挑逗，我还是强忍着做完足疗。最后在小姑娘叹服神情的注视下，我消失在夜色里。其实我兜里就70块钱，是穷让我成为了一个正直的人。','0','','0','0','','0','','0','1','|0','0','0');
