INSERT INTO `jian_news_data` VALUES('225','相亲时，女方问：请问你是做什么的？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男方：哦我玩碰碰车的。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女方：原来是碰碰车管理员啊！那你每月能挣多少？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男方：少则几千，多则几万吧！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女方：啊？怎么差这么多？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男方：唉遇见奥拓之类的车就挣少，奔驰之类的就挣多呗！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女方：尼玛碰瓷的&hellip;&hellip;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('226','今天，我在唱歌！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n突然，隔壁家的公狗在不停的叫！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：难道我的歌声这么动听啊，连狗狗都激动了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n这时候，我的邻居走过来：哥们，不要唱了，我家这狗已经发情了，你就不要在引诱它了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n卧草！！！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('227','酒桌上，三个人在胡侃。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n甲:&ldquo;想让老婆生孩子时一定要戒酒，要不然会生个傻子！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n乙:&ldquo;不一定，我孩子就是酒醉后跟媳妇爱爱怀上的，这不也考上北大啦！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n丙:&ldquo;你喝醉了，可是隔壁老王没喝酒！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n尼玛，绝交','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('228','甲：我们家很公平的，做任何家务事都是抓阄，谁抓到谁做。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n乙：别吹了，我怎么都是看到你洗碗、洗衣服、拖地，从来没有看到你老婆做？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n甲：唉，只能怪我手气不佳，每次都抓到。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n乙：尼玛，你手就这么臭，每次都是你抓到。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n甲：因为就一个阄啊，每次都是我先抓。','0','','0','0','','0','','0','1','|0','0','0');
