INSERT INTO `jian_news_data` VALUES('230','1、好热<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女孩说：&ldquo;好热啊！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n普通小伙猛摇蒲扇：来，我给你扇风！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n文艺小伙揽她入怀：这样，你便忘掉了热！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n二货小伙往外挪挪：尼玛，嫌热还不离我远点！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n2、好漂亮<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女孩说：&ldquo;你给我买的裙子好漂亮！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n普通小伙：只要你说漂亮就行！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n文艺小伙：无论什么衣服，穿你身上都会很漂亮！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n二货小伙：尼玛，我得啃一个月的窝窝头知道不？！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('231','女朋友：亲爱的，如果我怀孕了，不是你的孩子你会分手吗？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：都不是我的孩子，和我没有血缘关系当然要分手啦！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女朋友：你们男的这么看中血缘关系啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：那当然！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女朋友：好吧，亲爱的我怀孕了，不过孩子和你有血缘关系的！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：真的啊，我要做爸爸啦！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女朋友：爸爸估计你做不成，你可以做哥哥了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：。。。','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('232','今天，我和闺密去澡堂去洗澡！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n衣服都脱了，突然闺蜜：亲爱的，我屁股上是不是有个黑痣啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：没有啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n闺密：好吧，你老公就是个骗子，他竟然说我屁股上有颗黑痣！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我听了，感觉世界都灰了！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('233','老郭发了财。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n谦哥说：&ldquo;既然发了财，你就不能那么粗俗了，得学着高雅！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n&ldquo;高雅好啊！&rdquo;老郭也颇为认同：&ldquo;今年我过大寿，准备去请那个李云迪。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n谦哥赞叹：&ldquo;哟，这是要请他给你演奏钢琴么，他的指法可是十分了得！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n&ldquo;他的指法是了得，但我不请他弹钢琴！&rdquo;老郭颇为期待道：&ldquo;我要请他给我按摩，那样出神入化的指法，按起摩来肯定舒服！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n谦哥：.....','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('234','潘浚耗阏娴暮孟不赌悖你每天都出现我的梦里和脑海里！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n妹子：真的啊，我魅力这么大啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n潘浚旱比皇钦娴睦玻<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n妹子：如果我和你在一起了，你第一件事是干嘛？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n潘浚旱比皇歉你买衣服！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n妹子：为啥啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n潘浚阂蛭你在我的脑海中和梦中都是没穿衣服的，想给你先买个衣服穿上！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n妹子：滚！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('235','紫霞仙子老缠着孙悟空。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n孙悟空怒道：&ldquo;你他妈老缠着我干吗，都跟你说我不喜欢女人了！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n紫霞仙子：&ldquo;我知道。可我去问月老姻缘，他给我了一根红线，红线的一头是我，另一头却缠着.....&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n悟空：&ldquo;另一头缠着我？所以你一直缠着我？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n紫霞仙子：&ldquo;不！另一头缠着你的金箍棒！你要是肯把它给我，我自然就不会缠着你了！&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('236','女友是学生理的，不过只看过标本，没看过活体实物。于是要求我下面给她看看。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我自然没什么意见。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n她看着看着，说：&ldquo;你的蛋蛋坑坑洼洼的，怎么那么像月球？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我顿时就笑了：&ldquo;分明是地球！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n她摇头道：&ldquo;怎么会像地球？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我解释道：&ldquo;它装着几十亿人，地球也装着几十亿人啊！&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('237','甲：你老婆跟别人偷情，你干嘛无动于衷？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n乙：如果你老婆跟别人偷情后把你的零花钱涨了两倍，你会怎样？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n甲：睁只眼闭只眼&hellip;&hellip;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n乙：给你涨两倍就睁只眼闭只眼，告诉你，我老婆给我涨的是10倍，现在的零花钱都每月50了，你说我能不无动于衷吗&hellip;&hellip;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n甲：&hellip;&hellip;&hellip;&hellip;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('238','你好，我是本拉登，其实2011年我没死，死的是我的替身，我现在已经部署好了一套颠覆全球的恐怖计划，你只需要打5000块钱到我的微信，我就可以同中国的贱人笑网站建立合作关系，他们会为我们提供各种过硬的笑话，预计明年9月我们会占领白宫，接着拿下莫斯科，事成之后，我派戒灵去接你，然后让索伦辅佐你，我们占领整个地球，向宇宙进发，你看如何？\r\n<div>&nbsp;</div>\r\n','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('239','那天，我喝醉了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆故意抹口红，在我的衣服上亲几口！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n第二天，酒醒了，老婆特生气：你昨晚，在外面干嘛啦，你看看这口红印！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我一看，大笑！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：你犯错了，还笑！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：老婆，你别逗了，这么大的个口红印，除了你还有谁有这么大的嘴！','0','','0','0','','0','','0','1','|0','1','0');
INSERT INTO `jian_news_data` VALUES('240','早上起来，急匆匆往厕所跑，不一会又掉头回来，<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：这么快完事了？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老公：嘿嘿，拿手机，习惯了。说着冲进厕所，又掉头回来&hellip;&hellip;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：又咋的了？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老公拿起桌上的烟盒晃了晃：还有这呢。尼玛，空盒&hellip;&hellip;说着就随手抓起一把瓜子，往厕所跑？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：你抓瓜子干嘛？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老公：老婆，你不说的，想抽烟时就剥剥瓜子代替么！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：尼玛，你确定你这是上厕所？','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('241','下午逛街看见路边一小朋友在吃冰糖葫芦，旁边跟着一只成年大狗。小朋友太可爱了，肉嘟嘟的脸蛋，不知道那根经搭错了，我就过去左右捏起来。小朋友：&ldquo;哥哥，问你个事，你跑步快么&rdquo; &ldquo;还可以，读书时候百米全班第一&rdquo;，小朋友听完，指了指我，&ldquo;大黄，给我咬他&rdquo;，这货尼妈都追了我几条街了&nbsp;','0','','0','0','','0','','0','1','|0','0','0');
