INSERT INTO `jian_news_data` VALUES('244','我：老婆，我是不是你最爱的人！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：不是的！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：啥？你心里还有其他的人把！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：当然啦，没有那个人我都活不下去的！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：你你！！！！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：不要激动不要激动，我说的是毛爷爷，尤其是穿着红衣服的毛爷爷！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：尼玛，吓得我一身冷汗！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('245','老婆：老公，我的指甲漂亮不！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：太长了，剪剪吧！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：长才好看啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：可是长，不健康，对身体不好！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：胡说，我从来都没听说过指甲长影响健康的！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：谁胡说了，你看看我这脸，都多少口子啦，还不影响健康！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n不说了疼死我了！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('246','抗日战争年代，两日本特务混进上海，秘密寻找抗日分子，两人商量好，以学动物叫为暗号，结果，不久两特务被国军逮捕。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n特务:&ldquo;八嘎，你们滴，怎么发现，我们是特务滴干活？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n国军:&ldquo;呸，你他妈在大上海听见过野狼叫啊！&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('247','周末去朋友家玩，聊了一会听见里屋京剧响起，随后是他五岁儿子的大吼: 蓝脸的窦尔敦草泥马，红脸的关公床上趴，黄脸的鸡巴，白脸的菊花，黑脸的张飞大姨妈～～啊～～啊～～啊～～','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('248','老婆：&ldquo;老公你好厉害！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：&ldquo;怎么厉害啦？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：&ldquo;能娶到漂亮老婆的男人，要么有钱，要么英俊！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：&ldquo;我是哪一种？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：&ldquo;你既穷又丑，还能娶这么漂亮的媳妇，真厉害！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我呸。。。','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('249','儿子坐在沙发上看电视，不做作业，老妈举起手，啪，打在了老爸脸上：臭小子看见没？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老爸喊到：你打我干嘛？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老妈：老公，我这是着眼未来的教育。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老爸：啥？着眼未来？不懂。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老妈：我就是告诉他现在不好好学，将来就跟你一样，娶个狠老婆。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n儿子悄悄地进房间去&hellip;&hellip;','0','','0','0','','0','','0','1','|0','0','0');
