INSERT INTO `jian_news_data` VALUES('274','中午的时候，老婆要说要给娘家买点东西！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我不乐意道：&ldquo;给你娘家买东西，那可得用你娘家的钱！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n于是老婆就生气了，到了晚上，居然不做晚饭。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我问她：&ldquo;怎么不做晚饭？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n她说：&ldquo;不做了，我带你下饭馆！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n于是我高高兴兴跟她下饭馆。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n去的是一家小饭馆，吃的是私房菜，味道好极了。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n吃完后，要付账，老婆居然不掏钱。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我道：&ldquo;老婆，经济大权可在你手里，怎么还不付钱？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆道：&ldquo;吃私房菜，那可得用私房钱，我可不像某人有私房钱啊！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：．．．．．','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('275','妹子正在给车加油，突然抬头看到一大爷在那接电话，马上喊道：你，你怎么可以在这里接电话？不知道加油站里不能接移动电话吗？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n大爷：姑娘，你这么大声干嘛？大爷我这还不知道吗？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n妹子：知道还接？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n大爷：你没看到我一直站着没移动吗？','0','','0','0','','0','','0','1','|0','0','0');
