INSERT INTO `jian_news_data` VALUES('284','我发现一美女隔三差五的就来逛我的空间，而且经常看我照片。我有点小小的窃喜，觉得美女这么关注我，肯定是喜欢我。但是自己又不好意思问，于是就拜托朋友去打探打探情况。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n然后才知道，美女看我照片是因为每次她听别人描述谁长得丑的时候，都会迅速找到我的照片，并问：有多丑，有多丑，比这个人还丑吗？','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('285','今天回家，老婆做了一大桌子菜！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：老婆，今天啥日子啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：当然是好日子呗！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：我怎么不知道的啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：你一会儿就知道了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：好吧，还瞒着我，是不是想给我一个惊喜！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：好啦，好啦，我说出肯定惊死你！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：老婆我承受的了，你说吧！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n说完，老婆拿来了搓衣板：给我跪下，床底下的1000块钱怎么回事啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆，刚说完我就晕了，攒了一年的钱啊！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('286','老婆：老公，今天在楼下买包子，卖包子的男的拽着我不让我走，他想吃我的豆腐！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：什么，胆子不小！你等着！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我和老婆一起下去了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我上去就是把那个卖包子暴打了一顿！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n卖包子：哥，我求你了别打了，我知道你们肯定是黑社会的！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：谁黑社会了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n卖包子：不是黑社会，买包子不给钱，还来打我！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：啥？老婆你没给钱！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆：忘了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我拿出钱给卖包子的：不好意思了！我以为你看上我老婆了呢！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n卖包子：拉倒吧，我眼还没瞎！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('287','刚到宿舍，看到闺蜜在那哭，姐立刻走过去：妹子，咋的了？谁欺负我的妹妹了，告诉姐，姐去干他？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n闺蜜抬头，啪就给了一巴掌：你想的倒美。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n姐很生气：狗咬吕洞宾不识好人心，我是帮你呢，你这是干嘛啊？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n闺蜜：尼玛，我爸刚才来电话教训了我一顿，你去干他，你想当我妈？','0','','0','0','','0','','0','1','|0','0','0');
