INSERT INTO `jian_news_data` VALUES('341','男人和女人逛街，<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女人停下来：我腿疼，走不动了。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男人：我扶着你。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n又走了一会儿，<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女人：我肚子疼，走不动了。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男人：你怎么这么多事呢？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女人：你给我买个包就都不疼了。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男人：为什么？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女人：&ldquo;包&rdquo;治百病啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男人：&lsquo;包治百病&rsquo;是吧。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女人：是啊是啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n男人拿起一块砖：我让你看看什么叫&ldquo;砖&rdquo;治百病。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n女人吓得撒腿跑了。','0','','0','0','','0','','0','1','|0','0','1');
INSERT INTO `jian_news_data` VALUES('342','搬家的时候花了一笔搬家费，我坐车押运，指挥搬家公司把一个个家具轻挪轻放。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n终于忙完了之后，我轻轻地敲了敲家具门说道：&ldquo;爸妈儿子老婆出来吧。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆从大衣柜里面钻了出来，儿子则从书架里面钻了出来，爸妈分别从碗橱里面钻了出来。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我笑着对爸妈说道：&ldquo;嘿嘿，我这省钱水平可以吧，不然你们还要打车过来，花一百多块钱呢，我真是太有经济头脑了。&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('343','我有个朋友，脑子有点笨，写作文总是不知道起什么样的名字，我就对他说道：&ldquo;无论是什么，你只要写 X X 的故事就好了。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n他不解的说道：&ldquo;这招好使么？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我笑了笑道：&ldquo;描写景物，你就写大树的故事，杨树的故事，仙人掌的故事，是不是很好使。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n他开心的点了点头，我接着说道：&ldquo;写人物就更容易了，陈三的故事，老师的故事，警察的故事，编辑的故事，学生的故事。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n他更加有信心的点了点头，我接着说道：&ldquo;写动物也很简单啊，小乌龟的故事，小狗的故事，小兔子的故事。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n几天后，他鼻青脸肿的来找我，我忙问他怎么了。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n他哭着说道：&ldquo;那天老师让写老师和其他人物的故事，我就写了个女老师和男教导主任的故事，这顿把我给揍的！&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('344','老婆走到我身边，十分认真的对我说道：&ldquo;老公，你当是和我恋爱的时候，是不是对我撒谎了。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我一愣，有些不解的说道：&ldquo;什么意思。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆说道：&ldquo;你当时和我恋爱的时候说你很喜欢玩水，特别喜欢清澈的水在自己身上流动，你是不是骗了我。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我忙解释道：&ldquo;哪有，我没骗你，我真的，真的特别和水呆在一起，以前跟小伙伴在大河边就一个猛子扎下去，我是游得最快的，真没骗你。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老婆一听这话，开心的说道：&ldquo;是嘛，老公，既然是真的就好了，以后刷碗，拖地，洗鱼缸，洗浴缸这些活都交给你了，我还真担心你骗了我呢。&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('345','我去拜访一个大师，对大师说道：&ldquo;大师，有一个事情困扰我很多年了，从童年就在我心中挥之不散，希望大师能够帮我了却了。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n大师笑了笑道：&ldquo;说说看。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我问道：&ldquo;大师啊，唐僧一路被抓了那么多次，为什么妖怪抓到手不马上吃了它，这根本不符合逻辑啊。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n大师看了看我后说道：&ldquo;跟你说太多你也不懂，我们就拿个生活中的例子吧。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我点了点头，大师嘿嘿一笑道：&ldquo;你见过哪家说清仓大甩卖的店铺，一天后就关门的？你见过哪一个领导上来不扯几十分钟犊子就说正事的。&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('346','上初中物理课的时候，我十分不爱学习，因为上课根本听不懂，而且老师也是长相丑陋的欧巴桑。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我就特别喜欢睡觉，不过害怕班主任巡查，就告诉同桌，班任过来得时候，用笔尖扎我。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n有了同桌的应允后，我就开始安心睡觉，每当班主任视察，我就立刻清醒，装成读书的样子。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n那天，我正睡得好好地，感觉手臂一阵剧痛，清醒的时候，看到同桌手上拿着笔尖上有鲜血渗出，我骂道：&ldquo;你连扎那么多下是干嘛啊，你扎上瘾了啊。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n同桌无辜的说道：&ldquo;你看看外面。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我颤抖的说道：&ldquo;日了狗了，十二个班的班主任一起巡查，我也是醉了。&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('347','儿子刚上小学一年级，爸爸怕儿子输在起跑线上，要求儿子各方面都要做得好。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n爸爸：&ldquo;儿子，你知道决定一个人的成功到底是什么吗？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n儿子摇头：&ldquo;不知道。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n爸爸：&ldquo;是能力啊！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n儿子：&ldquo;那什么叫能力？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n爸爸：&ldquo;就是比别人强，厉害呗！懂么？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n儿子点点头。第二天，爸爸被老师叫到学校。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老师：&ldquo;你儿子真厉害！太能耐啦！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n爸爸笑道：&ldquo;老师您过奖了。&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n老师生气说：&ldquo;一上午，你儿子把班上五个学生全打哭了！！&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n爸爸：&hellip;&hellip;','0','','0','0','','0','','0','1','|0','0','0');
