INSERT INTO `jian_news_data` VALUES('349','以前爷爷喜欢下棋，下不过邻居大爷，很苦闷，我就想替他报仇。私下找邻居大爷，他说让我，我说不要，打开手机里&ldquo;象棋大师&rdquo;，调到专家难度。大爷下一步我摁一步，机器人下一步我学一步。大爷都傻了，连输4局，然后我就逃了。后来他居然找我拜师，说我是天才，一边玩手机都这么厉害，都不带想棋步的','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('350','姐昨天去剪了个头，由于天热，剪的短了点。从食堂回教室的路上听见三个初中在讨论我，&ldquo;你们猜那个人是男的还是女的？&rdquo;这不是高潮。姐冲过去指着胸口大吼&ldquo;睁大眼睛看看老子是男是女！&rdquo;小男孩颤抖的说。哥哥。我错了。','0','','0','0','','0','','0','1','|0','0','0');
