INSERT INTO `jian_news_data` VALUES('352','公司里来了两个女生面试，一个长发细腿人美波大，另一个身材相貌都很平庸。大家都打赌老总肯定会录取第一个，没想到老总却录取了后者。众人纳闷不已，只见老总说道「我就是要让那些漂亮的人知道，在这个社会立足光靠长相是根本没用的！」台下掌声雷动，三个月后那个没被录取的女人成了我们的老板娘。','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('353','上小学时班里一同学，稍微犯点事班主任就一顿狂抽，我们都纳闷为什么只有他挨揍！后来才知道原来班主任是他妈！GC是有一次挨揍以后正好校长从走廊经过，他抓着校长的胳膊告状，结果校长毫不犹豫的又一顿暴揍！我和小伙伴们正惊讶呢！班主任弱弱的说了一句&ldquo;爸，要上课了！晚上回家再打！&nbsp;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('354','　有对夫妻，郎才女貌，生了个小孩快两岁了，却总觉得小孩跟夫妻俩长的都不像。夫妻俩越来越不安，怀疑是不是当初在医院分娩时被医院给弄错了，于是一家三口去做了DNA亲子鉴定。鉴定的结果：丈夫跟小孩有血缘关系，妻子没有。。','0','','0','0','','0','','0','1','|0','0','0');
