INSERT INTO `jian_news_data` VALUES('356','前天中午，领导突然关切地问：&ldquo;你有女朋友吗？&rdquo; 我憨笑着说还没有。领导严肃地说：&ldquo;反正你也没女朋友，晚上留下来加个班。&rdquo; 今天中午，领导又关切地问：&ldquo;你有女朋友吗？&rdquo; 我想了想说：&ldquo;呵呵，昨天刚谈了一个。&rdquo; 领导又严肃地说：&ldquo;既然你都有女朋友了，也用不着满大街去找了，晚上留下来加个班。&rdquo;','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('357','女生寝室楼的对面是男生寝室楼。这晚刚入夜，万籁俱寂，忽听男寝楼中传来某男生高喊：&rdquo;xxx，我爱你！&rdquo;霎时对面楼层中的女人们炸开了锅，纷纷羡慕嫉妒这是谁家男友如此玩浪漫。然正当此时，却又听另一哥们儿大吼到：&rdquo;刚刚谁TM喊哥名字？！&rdquo;世界顿时安静了&hellip;&nbsp;','0','','0','0','','0','','0','1','|0','0','0');
