INSERT INTO `jian_news_data` VALUES('479','昨晚陪一朋友去相亲，见了面之后妹纸问我那朋友\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">&ldquo;在北京有房么？&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">朋友：&ldquo;没有&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">妹纸：&ldquo;有车么？&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">朋友：&ldquo;没有&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">妹纸：&ldquo;那你有北京户口么？&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">朋友：&ldquo;也没有&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">妹纸：&ldquo;你个穷潘可抖济挥谢寡人家相亲，也不看看自己拿衰样&hellip;&hellip;&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">朋友一听这话当时就急了，站起来大喊，我有福。</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">妹纸：&ldquo;你这样能有什么福？&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">朋友：&ldquo;我有敬业福&rdquo;</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">妹纸：哎呀死鬼，我跟你闹着玩的啦&hellip;&hellip;</p>\r\n','0','','0','0','','0','','0','1','|0','0','0');
