INSERT INTO `jian_news_data` VALUES('505','我老婆特别喜欢回娘家。从年三十到今天，我都不记得回过几次了。第一次带的腊肉香肠回来，第二次装的花生核桃回来，第三次带着儿子挣了500红包回来。\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">今天一大早，老丈人打电话把我训了一顿：你就不能把你老婆管紧点么，整天瞎跑个啥，我那点家底都快被她折腾光了。</p>\r\n<p style=\"margin: 1em 0px 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: 18px; line-height: 27px; font-family: helvetica, Arial, \'Hiragino Sans GB\', \'Microsoft YaHei\', simsun; vertical-align:  line; color: rgb(93, 93, 93);\">直到挂电话我都想说，你电话已经打晚了。</p>\r\n','0','','0','0','','0','','0','1','|0','0','0');
