INSERT INTO `jian_news_data` VALUES('510','甲：昨天我落水窒息，幸亏一美女过来给我人工呼吸，把我救了！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n乙：哇，你小子有福气啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n甲：可是，后来美女又给了我一耳光！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n乙：什么情况？<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n甲：美女正在人工呼吸，我突然苏醒，由被动变成主动了！','0','','0','0','','0','','0','1','|0','0','0');
INSERT INTO `jian_news_data` VALUES('511','村里来了一个算命的，听说什么都不用告诉他就能算，村里人都说好。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我就不信那个邪，他肯定背后用了什么把戏。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我就找到问他：你给算算我现在有几个孩子啊！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n算命的：一个。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我笑了：哈哈哈，傻逼，全村都知道我有俩孩子，哈哈哈！<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n算命的：我是说亲生的。<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n我：.......我擦！','0','','0','0','','0','','0','1','|0','1','0');
INSERT INTO `jian_news_data` VALUES('512','甲：&ldquo;俩口子吵架时，你睡哪里？&rdquo;<br style=\"margin: 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Simsun; font-size: 14px; line-height: 26px;\" />\r\n丙：&ldquo;要看哪个俩口子，我家俩口子吵架的时候，我睡沙发，别人家俩口子吵架的时候，我睡床底下，衣柜里也睡过&hellip;&hellip;&rdquo;','0','','0','0','','0','','0','1','|0','1','0');
