INSERT INTO `jian_news_data` VALUES('527','我躺在床上看着电视，女朋友无聊的摸着我的小丁丁，突然扭过头一脸认真的问我为啥你的丁丁皮那么长他们都没有呢！我不屑的扬起头淡淡的说到:你懂个屁，散装货和精装货能比么！只见她若有所思的底下了头，正当我准备为自己的这次装逼打分时，不对撒！他们？他们？他们？','0','','0','0','','0','','0','1','|0','0','0');
