INSERT INTO `jian_position_data` VALUES('8','2','2','content','1','0','array (\n  \'title\' => \'对不起姑娘，这是国内航班\',\n  \'description\' => \'机场里一个姑娘对着登机口跪地大哭：你为了国外的生活，就可以这么抛弃我么？连最后一面都不肯见我就偷偷跑掉，有种你走了就别他妈回来！　　一名工作人员走过来扶起姑娘，帮她拍掉身上的尘土：对不起姑娘，这是   \',\n  \'inputtime\' => \'1437831433\',\n  \'style\' => \'\',\n)','1','8','0','','0');
INSERT INTO `jian_position_data` VALUES('7','2','2','content','1','0','array (\n  \'title\' => \'英语没学好伤不起啊\',\n  \'description\' => \'猛然想起大学舍友，一直不知道她英语到底有多差。　　直到有一天&mdash;&mdash;我们逛完街脚疼准备打车回家，她优雅的一招手对着开来的出租车喊了一句：telephone！telephone！　　我在风中零乱了&hellip;&hellip;\',\n  \'inputtime\' => \'1437831355\',\n  \'style\' => \'\',\n)','1','7','0','','0');
INSERT INTO `jian_position_data` VALUES('9','2','2','content','1','0','array (\n  \'title\' => \'这俩活宝真是一对\',\n  \'description\' => \'一天商场购物，现金不足，刷卡。　　收银员很自然的将计算器给我输密码。　　当时我也没仔细看，就在上面输入密码，还配合的按了下归零键。　　结果打印机半天不出发票。　　收银员抬头看我：请您输入密码并按确   \',\n  \'inputtime\' => \'1437831596\',\n  \'style\' => \'\',\n)','1','9','0','','0');
INSERT INTO `jian_position_data` VALUES('11','2','2','content','1','0','array (\n  \'title\' => \'你觉得我是一个怎样的人\',\n  \'description\' => \'女孩静静的依偎在男孩的怀里，女孩问男孩：你觉得我是一个怎样的人？男孩答：你就像是一朵晨起的向日葵。女孩高兴的说：你是不是觉得我阳光、正直、善良啊！男孩回：你想的太多了，其实我的意思是你在找日。\',\n  \'inputtime\' => \'1437960036\',\n  \'style\' => \'\',\n)','1','11','0','','0');
INSERT INTO `jian_position_data` VALUES('12','3','2','content','1','0','array (\n  \'title\' => \'床上的席子太硬了\',\n  \'description\' => \'夏天的某日，看到一哥们在买护膝，我问他，你要去打球，还是去锻炼身体啊？这货丢了一句让我苦想了半天才明白的话。他说：床上的席子太硬了\',\n  \'inputtime\' => \'1437960098\',\n  \'style\' => \'\',\n)','1','12','0','','0');
INSERT INTO `jian_position_data` VALUES('24','2','2','content','1','0','array (\n  \'title\' => \'流行的方便面\',\n  \'description\' => \'小时候买方便面，先捏碎，再把调味包撒进去，使劲摇，然后吃，吃的剩下最后一点全倒手里，然后左右手倒来倒去，把多余的调味粉抖掉，觉得差不多了就一把扣嘴里，再把爪子舔干净。据说这时当年风靡一时的流行吃法。\',\n  \'inputtime\' => \'1439284934\',\n  \'style\' => \'\',\n)','1','24','0','','0');
INSERT INTO `jian_position_data` VALUES('21','2','2','content','1','0','array (\n  \'title\' => \'雾霾\',\n  \'description\' => \'唐僧师徒走在路上，看见前面有一座大山，山的一侧飘浮起一团团的雾气。唐僧大惊，叫道：悟空，前面好像有妖气。悟空的火眼金睛一照，笑道：师父，放心吧，那不是妖气。唐僧不相信：不是妖气是什么？悟空笑着说：   \',\n  \'inputtime\' => \'1439284426\',\n  \'style\' => \'\',\n)','1','21','0','','0');
INSERT INTO `jian_position_data` VALUES('29','2','2','content','1','0','array (\n  \'title\' => \'这句话有多少人懂？\',\n  \'description\' => \'一个男人在酒桌上喝酒正高兴的时候，妻子突然来电话说：5分钟必须到家，男人起身离开，朋友们都说：这么听媳妇的话啊！男人说了一句话，所有人都沉默了：我享受了她的青春，就要接受她的任性&hellip;&hellip;这句话有多少人懂   \',\n  \'inputtime\' => \'1439424780\',\n  \'style\' => \'\',\n)','1','29','0','','0');
INSERT INTO `jian_position_data` VALUES('28','2','2','content','1','0','array (\n  \'title\' => \'哥只能帮你到这里了\',\n  \'description\' => \'昨天我开着兰博基尼，在商场门口等朋友，看见马路对面一男的在表白，惨遭拒绝，女的说我们不合适，不是因为你没钱，真 的，你是个好人，谢谢你对我这么好，这时一辆老A6过来了，下来一个五十多岁的秃头猥琐大叔   \',\n  \'inputtime\' => \'1439424685\',\n  \'style\' => \'\',\n)','1','28','0','','0');
INSERT INTO `jian_position_data` VALUES('53','2','2','content','1','0','array (\n  \'title\' => \'改日吧\',\n  \'description\' => \'我对一漂亮mm说：今天我请你吃饭。她说：不吃了，改日吧～我很兴奋！我对一兄弟说：今天我请你吃饭。他说：不吃了，改日吧～我很尴尬&hellip;&hellip;一漂亮mm对我说：今天我请你吃饭。我说：不吃了，改日吧～她说不行-_-！一   \',\n  \'inputtime\' => \'1440375459\',\n  \'style\' => \'\',\n)','1','53','0','','0');
